syntax = "proto3";

package make87_messages_ros2.jazzy.ublox_msgs.msg;


message CfgNAV5 {
     uint32 mask = 1;
     uint32 dyn_model = 2;
     uint32 fix_mode = 3;
     int32 fixed_alt = 4;
     uint32 fixed_alt_var = 5;
     int32 min_elev = 6;
     uint32 dr_limit = 7;
     uint32 p_dop = 8;
     uint32 t_dop = 9;
     uint32 p_acc = 10;
     uint32 t_acc = 11;
     uint32 static_hold_thresh = 12;
     uint32 dgnss_time_out = 13;
     uint32 cno_thresh_num_svs = 14;
     uint32 cno_thresh = 15;
    repeated uint32 reserved1 = 16;
     uint32 static_hold_max_dist = 17;
     uint32 utc_standard = 18;
    repeated uint32 reserved2 = 19;
}
